text:
Poison, Poison Ivy’s the name....
I recreated & updated my Poison Ivy tutorial look from 2009😂 
last night for the @ysl X @iamhalsey GOTHAM CITY Costume Party.
🍃🍃🍃🍃🍃🍃🍃🍃🍃🍃🍃🍃🍃🍃
—————————————————————
WHAT I USED: 
@yslbeauty Touché Eclat Blur Primer 
@clinique beyond Perfecting Foundation (3 shades)
@maccosmetics 24 HOUR smooth wear concealer 
@maccosmetics x @patrickstarrr  Patrick’s Set Powder
@toofaced Pineapple Paradise Strobing Bronzer 
EYES: 
@makeupforeverofficial Artist Color pencil in Absolute Emerald - I applied all over eyelid and around eye then put shadow on top
@patmcgrathreal MTHRSHP Sublime Bronze Temptation Palette (the emerald green shade) 
@lorealmakeup voluminous Mascara 
Some cheap $2 lashes from @naimies 
LIP: @limecrimemakeup RED VELVET liquid lip
With @maccosmetics Lip liners mixed Nightmoth & Brick 
BROWS: I cut up ivy leaves from @michaelsstores and glued them on (just like my 2009 video😂😂) with @callas.iran Lash glue
WIG: @mykie x @bellamihair collab red wig
#poisonivy #poisonivycosplay #costume #makeup
